                            <tr>
                                <td>4</td>
                                <td>mantequilla</td>
                                <td>gramos</td>
                                <td><i class="far fa-comment-alt"></i></td>
                                <td>
                                <i class="far fa-trash-alt"></i>
                                &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                                <i class="fas fa-pen"></i>
                                </td>
                            </tr>
                        </tbody>
                        </table>
                        </div>
                    </section>
                </div>
            </section>

        )
    };
}

export default Products;
